const sourceCode = "---\ntitle: Implementing Dark Mode in React\ndate: '2025-01-05'\ntags: ['React', 'CSS', 'Theme', 'Frontend', 'Design']\ndescription: A comprehensive guide to implementing dark mode with system preferences detection and persistent user choice.\nenableComment: true\n---\n\n# Implementing Dark Mode in React\n\nDark mode has become an essential feature for modern web applications. Let's explore how to implement it properly with React.\n\n## Why Dark Mode Matters\n\n- Reduces eye strain in low-light environments\n- Saves battery on OLED screens\n- User preference and accessibility\n- Modern, polished feel\n\n## CSS Variables Example\n\nDefine theme colors as CSS variables:\n\n```css\n:root {\n  --bg-primary: #ffffff;\n  --bg-secondary: #f3f4f6;\n  --text-primary: #111827;\n  --text-secondary: #6b7280;\n  --border: #d1d5db;\n}\n\n[data-theme='dark'] {\n  --bg-primary: #1f2937;\n  --bg-secondary: #374151;\n  --text-primary: #f3f4f6;\n  --text-secondary: #9ca3af;\n  --border: #4b5563;\n}\n\nbody {\n  background-color: var(--bg-primary);\n  color: var(--text-primary);\n  transition: background-color 0.3s ease, color 0.3s ease;\n}\n```\n\n## React Context Implementation\n\n```jsx\nimport { createContext, useContext, useState, useEffect } from 'react'\n\nconst ThemeContext = createContext()\n\nexport function ThemeProvider({ children }) {\n  const [theme, setTheme] = useState('light')\n\n  useEffect(() => {\n    // Load saved theme\n    const savedTheme = localStorage.getItem('theme')\n    if (savedTheme) {\n      setTheme(savedTheme)\n    } else {\n      // Use system preference\n      const prefersDark = window.matchMedia('(prefers-color-scheme: dark)').matches\n      setTheme(prefersDark ? 'dark' : 'light')\n    }\n  }, [])\n\n  useEffect(() => {\n    // Apply theme to document\n    document.documentElement.setAttribute('data-theme', theme)\n    localStorage.setItem('theme', theme)\n  }, [theme])\n\n  const toggleTheme = () => {\n    setTheme(prev => prev === 'light' ? 'dark' : 'light')\n  }\n\n  return (\n    <ThemeContext.Provider value={{ theme, toggleTheme }}>\n      {children}\n    </ThemeContext.Provider>\n  )\n}\n\nexport function useTheme() {\n  const context = useContext(ThemeContext)\n  if (!context) {\n    throw new Error('useTheme must be used within ThemeProvider')\n  }\n  return context\n}\n```\n\n## Usage in Components\n\n```jsx\nfunction Header() {\n  const { theme, toggleTheme } = useTheme()\n\n  return (\n    <header>\n      <h1>My App</h1>\n      <button onClick={toggleTheme}>\n        {theme === 'light' ? 'üåô' : '‚òÄÔ∏è'}\n      </button>\n    </header>\n  )\n}\n```\n\n## Detecting System Preference\n\nListen to system theme changes:\n\n```javascript\nuseEffect(() => {\n  const mediaQuery = window.matchMedia('(prefers-color-scheme: dark)')\n  \n  const handleChange = (e) => {\n    if (e.matches) {\n      setTheme('dark')\n    } else {\n      setTheme('light')\n    }\n  }\n\n  mediaQuery.addEventListener('change', handleChange)\n  \n  return () => mediaQuery.removeEventListener('change', handleChange)\n}, [])\n```\n\n## Preventing Flash of Unstyled Content\n\nAdd a script in your HTML `<head>` to set theme before render:\n\n```html\n<script>\n  (function() {\n    const theme = localStorage.getItem('theme') || \n      (window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light')\n    document.documentElement.setAttribute('data-theme', theme)\n  })()\n</script>\n```\n\n## TailwindCSS Dark Mode\n\nIf using Tailwind, enable dark mode in config:\n\n```javascript\n// tailwind.config.js\nmodule.exports = {\n  darkMode: 'class', // or 'media' for system preference\n  // ... other config\n}\n```\n\nUsage:\n\n```jsx\n<div className=\"bg-white dark:bg-gray-900 text-black dark:text-white\">\n  This text changes color based on theme\n</div>\n```\n\n## Best Practices\n\n1. **Respect user preference** - Check system settings first\n2. **Persist choice** - Save to localStorage\n3. **Smooth transitions** - Use CSS transitions for theme changes\n4. **Test contrast ratios** - Ensure accessibility in both modes\n5. **Consider images** - Provide different versions for each theme if needed\n\n## Conclusion\n\nDark mode is more than just inverting colors. A thoughtful implementation respects user preferences, maintains accessibility, and enhances the overall user experience!";
